column8:
組み立てにハンダや接着剤は不要！3D メタリックパズル<br>
<br>
超精密レーザーカットによる<br>
ハイクオリティーメタリックパズル<br>
<br>
完成すれば手のひらサイズの立体オブジェが出来上がる。<br>
世界の著名の建物や乗り物を忠実に再現しています。<br>
<br>
組み立てはラジオペンチとニッパーだけで簡単！<br>
<br>
素材：金属<br>
タイプ：マスタング、F15、国会議事堂、五重塔、ブルジュ・ハリファ<br>
　　　　蜘蛛、サソリ、ドラム<br>
<br>
※対象年齢14歳以上<br>
※英語説明書（組み立て図）<br>
※日本語説明書はありません<br>
